import { useState } from 'react';

function Square({ value, onSquareClick }) {
  return (
    <button className="square" onClick={onSquareClick}>
      {value}
    </button>
  );
}

function Board({ xIsNext, squares, onPlay }) {
  function handleClick(i) {
    // 简单校验落子位置是否在棋盘纵横线交叉点（以索引能被棋盘边长整除简单模拟，实际可优化）
    if (i % 15!== 0 && i % 15!== 14 && Math.floor(i / 15)!== 0 && Math.floor(i / 15)!== 14) {
      return;
    }
    if (calculateWinner(squares) || squares[i]) {
      return;
    }
    const nextSquares = squares.slice();
    if (xIsNext) {
      nextSquares[i] = 'X';
    } else {
      nextSquares[i] = 'O';
    }
    onPlay(nextSquares);
  }

  const winner = calculateWinner(squares);
  let status;
  if (winner) {
    status = 'Winner: ' + winner;
  } else {
    status = 'Next player: ' + (xIsNext? 'X' : 'O');
  }

  return (
    <>
      <div className="status">{status}</div>
      <div className="board">
        {Array.from({ length: 15 }, (_, rowIndex) => (
          <div key={rowIndex} className="board-row">
            {Array.from({ length: 15 }, (_, colIndex) => (
              <Square
                key={`${rowIndex}-${colIndex}`}
                value={squares[rowIndex * 15 + colIndex]}
                onSquareClick={() => handleClick(rowIndex * 15 + colIndex)}
              />
            ))}
          </div>
        ))}
      </div>
    </>
  );
}

export default function Game() {
  // 初始化15×15的棋盘状态历史记录，初始为全空棋盘
  const [history, setHistory] = useState([Array(15 * 15).fill(null)]);
  const [currentMove, setCurrentMove] = useState(0);
  const xIsNext = currentMove % 2 === 0;
  const currentSquares = history[currentMove];

  function handlePlay(nextSquares) {
    const nextHistory = [...history.slice(0, currentMove + 1), nextSquares];
    setHistory(nextHistory);
    setCurrentMove(nextHistory.length - 1);
  }

  function jumpTo(nextMove) {
    setCurrentMove(nextMove);
  }

  const moves = history.map((squares, move) => {
    let description;
    if (move > 0) {
      description = 'Go to move #' + move;
    } else {
      description = 'Go to game start';
    }
    return (
      <li key={move}>
        <button onClick={() => jumpTo(move)}>{description}</button>
      </li>
    );
  });

  return (
    <div className="game">
      <div className="game-board">
        <Board xIsNext={xIsNext} squares={currentSquares} onPlay={handlePlay} />
      </div>
      <div className="game-info">
        <ol>{moves}</ol>
      </div>
    </div>
  );
}

function calculateWinner(squares) {
  const boardSize = 15;
  // 检查横向是否有五子连珠
  for (let row = 0; row < boardSize; row++) {
    for (let col = 0; col < boardSize - 4; col++) {
      const startIndex = row * boardSize + col;
      const piece = squares[startIndex];
      if (piece &&
        squares[startIndex] === squares[startIndex + 1] &&
        squares[startIndex] === squares[startIndex + 2] &&
        squares[startIndex] === squares[startIndex + 3] &&
        squares[startIndex] === squares[startIndex + 4]
      ) {
        return piece;
      }
    }
  }

  // 检查纵向是否有五子连珠
  for (let col = 0; col < boardSize; col++) {
    for (let row = 0; row < boardSize - 4; row++) {
      const startIndex = row * boardSize + col;
      const piece = squares[startIndex];
      if (piece &&
        squares[startIndex] === squares[startIndex + boardSize] &&
        squares[startIndex] === squares[startIndex + 2 * boardSize] &&
        squares[startIndex] === squares[startIndex + 3 * boardSize] &&
        squares[startIndex] === squares[startIndex + 4 * boardSize]
      ) {
        return piece;
      }
    }
  }

  // 检查正斜向（从左上角到右下角方向）是否有五子连珠
  for (let row = 0; row < boardSize - 4; row++) {
    for (let col = 0; col < boardSize - 4; col++) {
      const startIndex = row * boardSize + col;
      const piece = squares[startIndex];
      if (piece &&
        squares[startIndex] === squares[startIndex + boardSize + 1] &&
        squares[startIndex] === squares[startIndex + 2 * (boardSize + 1)] &&
        squares[startIndex] === squares[startIndex + 3 * (boardSize + 1)] &&
        squares[startIndex] === squares[startIndex + 4 * (boardSize + 1)]
      ) {
        return piece;
      }
    }
  }

  // 检查反斜向（从右上角到左下角方向）是否有五子连珠
  for (let row = 0; row < boardSize - 4; row++) {
    for (let col = 4; col < boardSize; col++) {
      const startIndex = row * boardSize + col;
      const piece = squares[startIndex];
      if (piece &&
        squares[startIndex] === squares[startIndex + boardSize - 1] &&
        squares[startIndex] === squares[startIndex + 2 * (boardSize - 1)] &&
        squares[startIndex] === squares[startIndex + 3 * (boardSize - 1)] &&
        squares[startIndex] === squares[startIndex + 4 * (boardSize - 1)]
      ) {
        return piece;
      }
    }
  }

  return null;
}
